import logo from '../images/logo.png';
const Navbar = () => {
    return (
        <nav className="w-full flex md:justify-center justify-between p-4  bg-gradient-to-r from-purple-800 to-blue-900">
            <div className="md:flex-[0.5] justify-center items-center">
                <img src={logo}  alt="" className="w-32 cursor-pointer"/>
            </div>
        </nav>
    );
}


export default Navbar;
